INSERT INTO `sop` VALUES (16,'Izin Masuk Data Center','<p><img alt=\"\" src=\"http://localhost/mondcoss-with-hak/ckeditor/plugins/imageuploader/uploads/4ddee48.png\" style=\"height:488px; width:546px\" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li><strong><strong>Tujuan :</strong></strong></li>\r\n</ol>\r\n\r\n<p>Agar aktivitas didalam&nbsp;<strong><strong>BPK RI</strong></strong>&nbsp;Data&nbsp;Center terkontrol dengan baik.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li><strong><strong>Ruang Lingkup : </strong></strong></li>\r\n</ol>\r\n\r\n<p>Untuk lokasi Datacenter di&nbsp;<strong><strong>BPK RI</strong></strong>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li><strong><strong>Detail Prosedur :</strong></strong></li>\r\n</ol>\r\n\r\n<ol>\r\n	<li>Vendor &nbsp;Data&nbsp;Center mengisi Data Log di pos keamanan</li>\r\n</ol>\r\n\r\n<p>Apakah ada tanda pengenal ? Apabila Ada, lanjutkan ke langkah 3</p>\r\n\r\n<ol>\r\n	<li>Apabila tanda pengenal tidak sesuai dengan data yg ada di pos keamanan maka Tenant silahkan menghubungi PIC Data&nbsp;Center (Nomor yang dapat dihubungi ada di Lobby Data&nbsp;Center)</li>\r\n</ol>\r\n\r\n<p>Apakah dapat Izin Masuk ? Apabila dapat izin, lanjutkan ke langkah 3</p>\r\n\r\n<p>Apabila tidak dapat izin , lalu Selesai</p>\r\n\r\n<ol>\r\n	<li>Tenant masuk ke area Data&nbsp;Center.</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n'),(18,'IJIN KELUAR BARANG DARI AREA DATACENTER','<p><br />\r\n<a href=\"http://localhost/mondcoss-with-hak/ckeditor/plugins/imageuploader/uploads/5e22d80.png\"><img alt=\"\" src=\"http://localhost/mondcoss-with-hak/ckeditor/plugins/imageuploader/uploads/5e22d80.png\" style=\"height:524px; width:728px\" /></a></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li><strong><strong>Tujuan :</strong></strong></li>\r\n</ol>\r\n\r\n<p>Agar barang yang keluar teridentifikasi sesuai dengan baik selain itu dapat memberikan kenyamanan terhadap tenant Data&nbsp;Center bahwa barang masuk dikontrol oleh manajemen Data&nbsp;Center dengan baik .</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li><strong><strong>Ruang Lingkup :</strong></strong></li>\r\n</ol>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Untuk lokasi Data&nbsp;Center di&nbsp;<strong><strong>BPK RI</strong></strong>.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li><strong><strong>Detail Prosedur :</strong></strong></li>\r\n</ol>\r\n\r\n<ol>\r\n	<li>Vendor Data Center mengisi form ijin barang keluar</li>\r\n	<li>Form ijin barang keluar telah diisi oleh Vendor Data Center</li>\r\n</ol>\r\n\r\n<p>Apakah Form ijin barang keluar telah di setujui oleh Operator Data Center? Apabila Tidak, lalu selesai</p>\r\n\r\n<p>Apabila Ya, Apakah Form ijin barang keluar telah disetujui oleh &nbsp;Management ? Apabila Tidak, lalu Selesai</p>\r\n\r\n<ol>\r\n	<li>Operator Data Center mendokumentasikan Form Ijin Barang Keluar yang telah disetujui oleh operator Data Center dan &nbsp;Management</li>\r\n	<li>Barang keluar dari Data Center</li>\r\n</ol>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<ol>\r\n	<li><strong><strong>Lampiran</strong></strong></li>\r\n</ol>\r\n\r\n<p>Form Ijin barang keluar</p>\r\n\r\n<p>&nbsp;</p>\r\n');
/*!40000 ALTER TABLE `sop` ENABLE KEYS */;
UNLOCK TABLES;

